    },
    detailClose: function detailClose() {
      this.showDetail = false;
    },
    getShufflePos: function getShufflePos(array) {
      var res = [],
          random;

      while (array.length > 0) {
        random = Math.floor(Math.random() * array.length);
        res.push(array[random]);
        array.splice(random, 1);
      }

      return res;
    }
  },
  components: {
